import React from 'react';
import './CardProduct.css';
import data from '../../mock-data.json';


function CardProduct() {
  return (
    <div>CardProduct
      <div>{data.map(obj => {
        return (
          <div key={obj.id}>
            <img src={obj.image}/>
            <p>{obj.title}</p>
            <p>{obj.price}</p>
            <p>{obj.description}</p>
          </div>
        );
      })}</div>
    </div>
  );
}

export default CardProduct;
